# 15
from typing import List
from datetime import datetime


class Solution:

    def twoSum(self, numbers: List[int], target: int, s: int, e: int) -> List[int]:
        solutions = set()
        ai = s
        bi = s + 1
        while ai < e:
            if bi >= e:
                ai += 1
                bi = ai + 1
                continue

            a = numbers[ai]
            b = numbers[bi]
            ss = a + b
            # print(f"{s=}, {e=}, {ai=}: {a=}, {bi=}: {b=}, {ss=}, {target=}")
            if ss == target:
                solutions.add(tuple(sorted([a,b])))

            if ss < target:
                if a == b:
                    ai += 1
                bi += 1
            else:
                ai += 1
                bi = ai + 1

        return solutions

    def threeSum(self, nums: List[int], ts = None) -> List[List[int]]:
        nums = list(sorted(nums))
        # print(nums)
        if ts:
            print("sort", datetime.now() - ts)
        n = len(nums)
        solutions = {}
        for i in range(0, n - 2):
            vi = nums[i]
            if i > 0 and nums[i - 1] == vi:
                continue

            target = 0 - vi
            sol2s = self.twoSum(nums, target, i + 1, n)
            # print("=--------------", sol2s)
            if sol2s:
                for ss in sol2s:
                    solutions.setdefault(tuple([vi, ss[0], ss[1]]), True)

        return list(solutions.keys())


nums = [-1,0,1,2,-1,-4]
print(nums)
print(Solution().threeSum(nums))

